
public class hash {
	public static void main(String args[]){
		String hash="";
		int k=0;
		for(int i=0;i<hash.length();){
			if((i+31) > hash.length()){
				System.out.println("hash  "+k+":"+ hash.substring(i, hash.length()));
				k++;
			}
			else{
				k++;
				System.out.println("hash  "+ k+" : "+ hash.substring(i, i+31));
			}
			
			i=i+31;
		}
		
	}
}
